import Link from 'next/link';

export default () => (
    <section>
        <nav>
            <Link href="/"><a>Home</a></Link>
            <Link href="/about"><a>About</a></Link>
        </nav>
        <style jsx>{`
            nav {
                display:flex;
            }
            nav a {
                background-color:#333;
                padding: 2rem;
                margin: 0 .5em;
            }
        `}</style>
    </section>
);
